const AllRecipies = ({setOne, changeView, data}) => {
  console.log(data);
  return (
    <div className="card-container">
      {data.map((e, i) => (
        <RecepieCard e={e} key={i} setOne={setOne} changeView={changeView} />
      ))}
    </div>
  );
};


